import React from 'react'

const Header = (props) => {
  return (
    <h1>{props.course}</h1>
  )
}

const Content = (props) => {
  return (
    <Part partName={props.partNames[0]} partExercises={props.partExercises[0]}/>
  )
}

const Part = (props) => {
  return (
    <p>{props.partName} {props.partExercises}</p>
  )
}

const App = () => {
  const course = 'Half Stack application development'
  const part1 = 'Fundamentals of React'
  const exercises1 = 10
  const part2 = 'Using props to pass data'
  const exercises2 = 7
  const part3 = 'State of a component'
  const exercises3 = 14

  return (
    <div>
      <Header course={course}/>
      <Content partNames={[part1, part2, part3]} partExercises={[exercises1, exercises2, exercises3]} />
      <Content partName={part2} partExercises={exercises2} />
      <Content partName={part3} partExercises={exercises3} />

      {/* <p>
        {part1} {exercises1}
